import React from 'react';
import asheville from './Liza-Asheville.jpg';

function Home() {
  return (
    <div>
      <img src={asheville} className="asheville-photo" alt="asheville" />
      <div className="nav-text">
        <p><a href="/">Home</a></p>
        <p>Gallery</p>
        <p>Contact</p>
        <p>About</p>
      </div>
      <div className="title">
        Liza Morrison Art
      </div>
    </div>
  );
}

export default Home;
